CREATE TABLE `app_lawcase_basicoption` (
  `ID` varchar(32) NOT NULL,
  `BASIC_ID` varchar(32) DEFAULT NULL COMMENT 'conf_id',
  `COL_NAME` varchar(32) DEFAULT NULL COMMENT '每个列表值，都与对应的基本信息的列名一致，例如：LAWCASE_TYPE的代表案件类型，则COL_NAME就是LAWCASE_TYPE',
  `TABLE_NAME` varchar(32) DEFAULT NULL,
  `OPTIONS_NAME` varchar(32) DEFAULT NULL COMMENT '下拉列表中的选项名称',
  `OPTIONS_VALUE` varchar(32) DEFAULT NULL COMMENT '在同一个COL_NAME下，OPTIONS_VALUE唯一',
  `CREATE_USERID` varchar(32) DEFAULT NULL,
  `CREATE_USERNAME` varchar(32) DEFAULT NULL,
  `CREATE_TIME` date DEFAULT NULL,
  `ORDERBY_CODE` varchar(32) DEFAULT NULL COMMENT '可利用排序码对 特征进行手工调序，建议排序码按照 1/2/3/4/5的方式升序排列',
  `IS_VALID` varchar(2) DEFAULT NULL,
  `BUSI_CODE` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `INDEX_OPTINS_VALUE` (`OPTIONS_VALUE`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='案件基本信息特征项';

